AGI Open Rotterdam took place one week ago today … if you missed it, or you would like to read more about our dynamic programme and the more than 60 speakers and workshop leaders who joined us, read ‘AGI Open Rotterdam Preview’ on Neshan’s website (@neshanmag). 🔺

The Iranian graphic design magazine Neshan is a professional and educational publication that aims to promote ‘the design & visual culture intention of ameliorating ties between the graphic designers of Iran, Asia and all parts of the world.’ Neshan’s Editor-in-chief Majid Abbasi (Iran) was inducted into Alliance Graphique Internationale in 2009. 
